char * MD5Digest(char * md5Buf) {
    MD5_CTX context;
    unsigned char * digest = (unsigned char *) malloc(sizeof(unsigned char) * (RESPONSE_LEN+2));
    
    MD5Init(&context);
    MD5Update(&context, (unsigned char*) md5Buf, CHALLENGE_LEN+MAX_PASSWORD_LEN);
    MD5Final(digest, &context);
    
    return (char *) digest;
}


